const IMAGE = (props) => {
    return ( 
        (() => {
            let size = Number(props.size);
            if(size === 1){
                return (
                    <div className="single-image">
                        <img className="single-image" src={props.image} alt={props.alt} />
                    </div>
                )
            } else {
                return (
                    <div className="image-gallery">

                    </div>
                )
            }
        })()
     );
}
 
export default IMAGE;
